Question: Andrew tried to compute his expenses for the game night. If he spent $9.00 for each game they played and they played a total of 5 games, how much money did he spend that night?

Explanation: Andrew spent $9.00 for each game they played. They played a total of 5 games. To find the total amount of money he spent, we need to multiply the cost of each game by the number of games played. So, we multiply $9.00 by 5. This gives us $9.00 * 5 = $45.00. Therefore, Andrew spent $45.00 that night.

Answer: {45.00}

